import {useEffect, useState} from "react";
import Detail from "./routes/Detail";

import { 
  BrowserRouter as Router, 
  Switch, 
  Route,} from "react-router-dom";
import Home from "./routes/Home";

function App2(){
  return <Router>
    <Switch>
      <Route path='/'>
        <Home/>
      </Route>
      <Route path='/movie'>
        <Detail/>
      </Route>
    </Switch>
  </Router>;
}

export default App2;
